import React from 'react';
import { StyleSheet,View,Text,ScrollView } from 'react-native';
import { Appbar,Card, Button,Title,Paragraph  } from 'react-native-paper';

function Products() {
    return (
         <ScrollView style = {styles.background}>
          
                {/* card Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5, height:300}} source={require('../assets/smartswitch.jpg') }  />
                 <Card.Content>
                 <Title>Home Automation </Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>
                
                {/* card2 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5, height:300}} source={require('../assets/keyFinder.jpg') } />
                 <Card.Content>
                 <Title>Key Finder </Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>
 
               {/* card3 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5, height:300}} source={require('../assets/inverter.jpg') } />
                 <Card.Content>
                 <Title>Inverters</Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>

               {/* card4 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5, height:300}} source={require('../assets/camera.jpg') } />
                 <Card.Content>
                 <Title>Survullence camera</Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>

               {/* card5 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 1, height:300}} source={require('../assets/socketboard.jpg') } />
                 <Card.Content>
                 <Title>SocketBoard</Title>
                 <Text>2.5$</Text>
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>
                
         </ScrollView>
    );
}

const styles = StyleSheet.create({
     background: {
          backgroundColor: '#FAFAFAFA',
         
     },
     card: {
          margin:25
     },
     btn: {
          backgroundColor: '#242945',
      
     },
     st:{
          color:'#d4aa04'
     }
}

);

export default Products;
